CREATE DATABASE CoderHouse
GO

USE CoderHouse
GO

CREATE TABLE CoderHouse.dbo.Area(
	AreaID INT PRIMARY KEY NOT NULL,
    Nombre NVARCHAR(255));
    
CREATE TABLE CoderHouse.dbo.Profesiones(
	ProfesionesID INT PRIMARY KEY NOT NULL,
    Profesiones NVARCHAR(255));
    
CREATE TABLE CoderHouse.dbo.Encargado(
	Encargado_ID INT PRIMARY KEY NOT NULL,
    Nombre NVARCHAR(255),
    Apellido NVARCHAR(255),
    Documento INT,
    Domicilio NVARCHAR(255),
    Codigo_Postal NVARCHAR(255),
    Telefono NVARCHAR(255),
    Tipo NVARCHAR(255));
    
CREATE TABLE CoderHouse.dbo.Asignaturas(
	AsignaturasID INT PRIMARY KEY NOT NULL,
    Nombre NVARCHAR(255),
    Tipo NVARCHAR(255),
    Jornada NVARCHAR(255),
    Costo REAL,
    Area INT,
    FOREIGN KEY (Area) REFERENCES Area (AreaID));
    
CREATE TABLE CoderHouse.dbo.Staff(
	DocentesID INT PRIMARY KEY NOT NULL,
    Nombre NVARCHAR(255),
    Apellido NVARCHAR(255),
    Documento INT,
    Correo NVARCHAR(255),
    Telefono NVARCHAR(255),
    Domicilio NVARCHAR(255),
    Codigo_Postal NVARCHAR(255),
    Fecha_Ingreso DATE,
    Camada NVARCHAR(255),
    Profesion INT,
    Encargado INT,
    Asignatura INT,
    FOREIGN KEY (Profesion) REFERENCES Profesiones (ProfesionesID),
    FOREIGN KEY (Encargado) REFERENCES Encargado (Encargado_ID),
    FOREIGN KEY (Asignatura) REFERENCES Asignaturas (AsignaturasID));
    
CREATE TABLE CoderHouse.dbo.Estudiantes(
	EstudiantesID INT PRIMARY KEY NOT NULL,
    Nombre NVARCHAR(255),
    Apellido NVARCHAR(255),
	Documento INT,
    Correo NVARCHAR(255),
    Telefono NVARCHAR(255),
    Domicilio NVARCHAR(255),
    Codigo_Postal NVARCHAR(255),
    Fecha_Nacimiento DATE,
    Fecha_Ingreso DATE,
    Profesion INT,
    Docente INT,
	FOREIGN KEY (Profesion) REFERENCES Profesiones (ProfesionesID),
    FOREIGN KEY (Docente) REFERENCES Staff (DocentesID));
    









